// 1- Crie um novo projeto utilizando npx create-react-app nome-app e acesse a pasta nome-app
// 2- Crie uma lista de tarefas simples seguindo os passos abaixo:
import React from 'react';
import './App.css';

const tarefa = ['Acordar', 'Tomar café', 'escovar os Dentes', 'estudar', 'Fazer Almoço', 'Escovar os dentes'];

const App = () => (<ul>Tarefas diárias:{ tarefa.map(tarefa => <li>{ tarefa }</li>) }</ul>);


export default App;
